import React from 'react';



const Fetchpokemon = function ({pokemons,url}){

	     var arr =[]
	     for (let i of pokemons){
            arr.push(<li key={pokemons.indexOf(i)}>{i}</li>)
	     }
	     return arr;
}


















export default Fetchpokemon;
